import lipton from "../images/lipton.png"
import fanta from "../images/fanta.png"
import liptonGreen from "../images/liptonGreen.png"
import cocacola from "../images/coca-cola.png"
import liptonpeach from "../images/lipton-peach.png"
import cocazero from "../images/cocazero.png"
import Card from "../UI/Card";
const Drinks=()=>{
    const Dummy_Drink=[
        {
          id: Math.random(),
          name: "Lipton Ice-tea®",
          price: 1.99,
          src:lipton,
        },
        {
          id: Math.random(),
          name: "Lipton® Peach Ice Tea",
          price: 1.99,
          src:liptonpeach,
        },
        {
          id: Math.random(),
          name: "Coca-Cola®",
          price: 1.99,
          src:cocacola,
        },
        {
          id: Math.random(),
          name: "Fanta®",
          price: 1.99,
          src:fanta,
        },
        {
          id: Math.random(),
          name: "Coca-Cola® Zero",
          price: 1.99,
          src:cocazero,
        },
        {
          id: Math.random(),
          name: "Coca-Cola® Zero",
          price: 1.99,
          src:cocazero,
        },
      ]
      const ListofDrink = Dummy_Drink.map((meal) => (
        <Card key={meal.id} id={meal.id} name={meal.name} price={meal.price}src={meal.src}/>
      ));
      return (
        <section>
        <ul className="row">{ListofDrink}</ul>
        </section>
      );
}
export default Drinks;
